import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Login from './pages/Login';
import Register from './pages/Register';
import ProtectedRoute from './components/ProtectedRoute';
import DashboardAdmin from './pages/DashboardAdmin';
import DashboardUser from './pages/DashboardUser';
import DashboardOwner from './pages/DashboardOwner';
import StoreList from './pages/StoreList';

const App = () => {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/user" element={<ProtectedRoute allowedRoles={["Normal User"]}><DashboardUser /></ProtectedRoute>} />
        <Route path="/admin" element={<ProtectedRoute allowedRoles={["System Administrator"]}><DashboardAdmin /></ProtectedRoute>} />
        <Route path="/owner" element={<ProtectedRoute allowedRoles={["Store Owner"]}><DashboardOwner /></ProtectedRoute>} />
        <Route path="/stores" element={<StoreList />} />
      </Routes>
    </>
  );
};

export default App;
